      if((e.ctrlKey||e.metaKey)&&e.shiftKey){e.preventDefault();e.stopPropagation();return false}
      if((e.ctrlKey||e.metaKey)&&/^[uUsSpPaAcC]$/.test(e.key)){e.preventDefault();e.stopPropagation();return false}
      if(e.key==="PrintScreen"){document.body.innerHTML="";return false}
    },true);

    ["copy","cut","paste","dragstart","selectstart"].forEach(function(ev){
      document.addEventListener(ev,function(e){e.preventDefault();return false},true);
    });

    window.print=function(){return false};

    // Also apply protections inside the iframe once it loads
    fr.addEventListener("load",function(){
      try{
        var d=fr.contentDocument;
        d.body.style.userSelect="none";
        d.body.style.webkitUserSelect="none";
        d.body.style.MozUserSelect="none";
        d.body.style.webkitTouchCallout="none";
        d.addEventListener("contextmenu",function(e){e.preventDefault();return false},true);
        d.addEventListener("keydown",function(e){
          if(e.key==="F12"||e.keyCode===123){e.preventDefault();e.stopPropagation();return false}
          if((e.ctrlKey||e.metaKey)&&e.shiftKey){e.preventDefault();e.stopPropagation();return false}
          if((e.ctrlKey||e.metaKey)&&/^[uUsSpPaAcC]$/.test(e.key)){e.preventDefault();e.stopPropagation();return false}
          if(e.key==="PrintScreen"){document.body.innerHTML="";return false}
        },true);
        ["copy","cut","paste","dragstart","selectstart"].forEach(function(ev){
          d.addEventListener(ev,function(e){e.preventDefault();return false},true);
        });
        d.defaultView.print=function(){return false};
      }catch(x){}
    });



    // Debugger trap
    setInterval(function(){(function(){return false})["constructor"]("debugger")()},500);

    // Dev tools detector
    var _d=new Image();
    Object.defineProperty(_d,"id",{get:function(){
      fr.srcdoc="";
      document.body.innerHTML='<div style="display:flex;align-items:center;justify-content:center;height:100vh;background:#F8F7F4;font-family:sans-serif;color:#C0392B"><p>Access denied.</p></div>';
    }});
    setInterval(function(){console.log("%c",_d)},2000);

    // Wipe console
    ["log","warn","error","info","debug","table","dir"].forEach(function(m){console[m]=function(){}});
    console.clear();

  }catch(x){
    document.getElementById("s").style.display="none";
    document.getElementById("e").style.display="block";
  }
}

document.getElementById("u").addEventListener("click",go);
document.getElementById("p").addEventListener("keydown",function(e){if(e.key==="Enter")go()});
